import axios from 'axios';


export default function TelaInfo() {

    const [pessoa, setPessoa] = useState([])

    const getProfileToChoose = () => {
        axios
          .get(
            "https://us-central1-missao-newton.cloudfunctions.net/astroMatch/nastia/person",

          )
          .then(res => {
           console.log(res.data.profile);
           setPessoa(res.data.profile)

          })
          .catch(err => {
            console.log(err);
          })

      };
      useEffect(() => {
        getProfileToChoose(pessoa);
      }, []);

      const perfil = getProfileToChoose()
      const novoPerfil = perfil.map=(pessoa)=>{
          return <div key={pessoa.id}> {pessoa.name}</div>
      }


  return (
    <div>
       novoPerfil


    </div>
)
}
